import React, { Component } from "react";

class AppNav extends Component {
    render() {
        return (
            <nav>
                <ul>
                    <li><a>Shop</a></li>
                    <li><a>Login</a></li>
                    <li><a>Register</a></li>
                </ul>
            </nav>
        );
    }
}

export default AppNav;
